import React, { useState } from "react";
import "./Auth.css";
import { MDBContainer, MDBRow, MDBCol, MDBInput, MDBBtn } from "mdbreact";
import CardCatalog from "../../global/components/front-end-comps/CardCatalog";

const Auth = () => {
  return (
    <CardCatalog className="log-form">
      <MDBContainer>
        <MDBRow>
          <MDBCol>
            <form>
              <p className="h5 mb-4 text-center">Login</p>
              <div className="grey-text">
                <MDBInput
                  id="email"
                  label="Email"
                  group
                  icon="envelope"
                  type="email"
                  validate
                  error="wrong"
                  success="right"
                  // onChange={(e) => setLocation(e.target.value)}
                />
                <MDBInput
                  id="password"
                  label="Password"
                  icon="lock"
                  group
                  type="password"
                  validate
                  // onChange={(e) => setDescription(e.target.value)}
                />
              </div>
              <div className="text-center rounded-0">
                <MDBBtn type="submit">LOGIN</MDBBtn>
              </div>
            </form>
          </MDBCol>
        </MDBRow>
      </MDBContainer>
    </CardCatalog>
  );
};

export default Auth;
